import React from 'react';

const menuStyle = {
    width: '100px',
    height: '100px',
    backgroundSize: 'cover',
    backgroundImage: 'url(data:image/png;base64,)',
}

function Header() {
    return (
        <div className="header">
            <button style={ menuStyle } />
        </div>
    )
}

export default Header;
